values.text:
Alguns sintomas identificam a hora correta de descarbonizar o motor. Que são eles:

estouros no escapamento;
marcha lenta irregular;
pouca potência (notada nas subidas ou ultrapassagens);
falta de lubrificação no comendo de válvulas;
travamento das válvulas;
batidas de tucho;
formação pastosa no comando e prováveis entupimentos;
formação pastosa no cárter;
obstrução da bomba de óleo;
entupimento do pescador da bomba

1. Deslize o fole no eixo junto com a abraçadeira inferior;
2. Posicione a junta homocinética nas estrias da extremidade do eixo;
3. Insira a junta homocinética no eixo;
4. Encha com a massa lubrificante fornecida (graxa grafitada);
5. Instale a abraçadeira grande e aperte-a;
6. Instale o eixo e transmissão e verifique igualmente se o sensor de ABS funciona corretamente.
